import React from 'react'


const CompetitionEntry = () => {

    const offlineData = async (formdata, { resetForm }) => {

        console.log(formdata)
        // resetForm()

        const res = await fetch('http://localhost:5000/competition/add', {
            method: 'POST',
            body: JSON.stringify(formdata),
            headers: {
                'Content-Type': 'application/json'
            }
        })

        console.log(res.status);

        if (res.status === 200) {
            Swal.fire({
                icon: 'success',
                title: 'Success',
                text: 'Data Added Successfully'
            })
            resetForm()
        }

    }






    return (
        <div className='container mt-3'>

            <h2 className='text-center'>ENTER DETAILS OF COMPETITION</h2>
            <div className="row mt-3">

                <div className="col-md-6">

                    <div className="form-check mt-2">
                        <input
                            className="form-check-input"
                            type="radio"
                            name="flexRadioDefault"
                            id="offline"
                        />
                        <label className="form-check-label" htmlFor="offline">
                            Offline
                        </label>
                    </div>
                    <div className="form-check">
                        <input
                            className="form-check-input"
                            type="radio"
                            name="flexRadioDefault"
                            id="online"
                        />
                        <label className="form-check-label" htmlFor="online">
                            Online
                        </label>
                    </div>

                    <div className="my-3">
                        <label className="form-label" htmlFor="form12">
                            <b>Date and Time</b>
                        </label>
                        <input type="datetime-local" id="form12" className="form-control" name='date' />
                    </div>

                    <div className="mb-3">
                        <label className="form-label" htmlFor="textAreaExample">
                            <b>Rules</b>
                        </label>
                        <textarea
                            className="form-control"
                            id="textAreaExample"
                            rows={4}
                            name='rules'
                        // onChange={handleChange}
                        // value={values.rules}
                        />
                    </div>

                    <div className="mb-3">
                        <label className="form-label" htmlFor="textAreaExample">
                            <b>Venue</b>
                        </label>
                        <textarea
                            className="form-control"
                            id="textAreaExample"
                            rows={4}
                            name='venue'
                        // onChange={handleChange}
                        // value={values.venue}
                        />
                    </div>


                </div>



                <div className="col-md-6">

                    <div className="mb-3">
                        <label className="form-label" htmlFor="textAreaExample">
                            <b>Description</b>
                        </label>
                        <textarea
                            className="form-control"
                            id="textAreaExample"
                            rows={4}
                            name='description'
                        // onChange={handleChange}
                        // value={values.description}
                        />
                    </div>

                    <div className="mb-3">
                        <label className="form-label" htmlFor="textAreaExample">
                            <b>Rewards</b>
                        </label>
                        <textarea
                            className="form-control"
                            id="textAreaExample"
                            rows={4}
                            name='rewards'
                        // onChange={handleChange}
                        // value={values.rewards}
                        />
                    </div>

                    <div className="mb-3">
                        <label className="form-label" htmlFor="textAreaExample">
                            <b>Requirement</b>
                        </label>
                        <textarea
                            className="form-control"
                            id="textAreaExample"
                            rows={4}
                            name='requirement'
                        // onChange={handleChange}
                        // value={values.requirement}
                        />
                    </div>

                </div>

            </div>
        </div>
    )
}

export default CompetitionEntry
